using namespace std;


template <typename T>
class ListNode {
public:
    T data;
    ListNode<T>* Prev;
    ListNode<T>* pNext;

    ListNode(T i, ListNode<T>* prev, ListNode<T>* nxt) : data(i), Prev(prev), pNext(nxt) {}
};

template <typename T>
class List {
private:
    ListNode<T>* first, * current, * last;
    int size;
    int sizeMax;

    ListNode<T>* findAt(int p);

public:
    List();
    ~List();

    void addAtFront(T d);
    void addAtEnd(T d);
    void addAt(int p, T i);
    T* removeAtFront();
    T* removeAtEnd();
    T* removeAt(int p);
    void Show();
    void demo();
    void sortListA();
    void SaveBinaryFile();
    void LoadBinaryFile();
    T* getAt(int p);
    T* getAtFront();
    T* getAtEnd();
    int getSizeMaxList();
    void setSizeMaxList(int s);
    int getSizeList();
    void setAtStart();
    void setAtEnd();
    T* getNext();
    T* getPrevious();
};

template <typename T>
List<T>::List() : first(nullptr), current(nullptr), last(nullptr), size(0), sizeMax(8) {}

template <typename T>
List<T>::~List() {
    ListNode<T>* temp = first;
    while (temp != nullptr) {
        ListNode<T>* n = temp->pNext;
        delete temp;
        temp = n;
    }
}

template <typename T>
void List<T>::addAtFront(T d) {
    if (size != sizeMax) {
        ListNode<T>* temp = new ListNode<T>(d, nullptr, first);

        if (first != nullptr) {
            first->Prev = temp;
        }
        first = temp;
        if (last == nullptr) {
            last = temp;

            size++;
        }
        else {
            cout << "Error 404: Место в списке ограничено" << endl;
        }
    }
}
    template <typename T>
    void List<T>::addAtEnd(T d) {
        if (size != sizeMax) {
            if (size == 0) {
                addAtFront(d);
            }
            else {
                ListNode<T>* temp = new ListNode<T>(d, last, nullptr);
                last->pNext = temp;
                last = temp;
                size++;
            }
        }
        else {
            cout << "Error 404: Место в списке ограничено" << endl;
        }
    }
    template <typename T>
    void List<T>::addAt(int p, T i) {
        if (size != sizeMax) {
            if (p == 0) {
                addAtFront(i);
            }
            else if (p == size) {
                addAtEnd(i);
            }
            else {
                ListNode<T>* temp = findAt(p);
                if (temp != nullptr) {
                    ListNode<T>* l = new ListNode<T>(i, temp->Prev, temp);
                    temp->Prev->pNext = l;
                    temp->Prev = l;
                    size++;
                }
            }
        }
        else {
            cout << "Error 404: Место в списке ограничено" << endl;
        }
    }

    template <typename T>
    T* List<T>::removeAtFront() {
        if (size == 0) {
            cout << "No item to be removed at front of list" << endl;
            return nullptr;
        }

        T temp_data = first->data;
        ListNode<T>* temp = first;

        if (first->pNext != nullptr) {
            first->pNext->Prev = nullptr;
        }
        first = first->pNext;
        size--;

        if (size == 0) {
            last = nullptr;
        }
        delete temp;
        return new T(temp_data);
    }

    template <typename T>
    T* List<T>::removeAtEnd() {
        if (size == 0) {
            cout << "No item to be removed at end of list" << endl;
            return nullptr;
        }

        T temp_data = last->data;
        ListNode<T>* temp = last;

        if (last->Prev != nullptr) {
            last->Prev->pNext = nullptr;
        }
        last = last->Prev;
        size--;

        if (size == 0) {
            first = nullptr;
        }
        delete temp;
        return new T(temp_data);
    }

    template <typename T>
    T* List<T>::removeAt(int p) {
        if (p < 0 || p >= size) {
            cout << "No item to be removed at list position " << p << endl;
            return nullptr;
        }

        if (p == 0) {
            return removeAtFront();
        }

        if (p == size - 1) {
            return removeAtEnd();
        }

        ListNode<T>* temp = findAt(p);
        T temp_data = temp->data;

        temp->Prev->pNext = temp->pNext;
        temp->pNext->Prev = temp->Prev;
        size--;

        delete temp;
        return new T(temp_data);
    }

