        ListNode<T>* temp = last;

        while (temp != nullptr) {
            cout << temp->data << " - ";
            temp = temp->Prev;
        }

        cout << "End" << endl;
    }

    template <typename T>
    ListNode<T>* List<T>::findAt(int p) {
        ListNode<T>* temp = first;
        for (int i = 0; i < p && temp != nullptr; i++) {
            temp = temp->pNext;
        }
        return temp;
    }

    template <typename T>
    void List<T>::sortListA() {
        ListNode <T>* t, * m, * a, * b;
        if (first == nullptr) {
            return;
        }

        for (bool go = true; go;) {
            go = false;
            a = t = first;
            b = first->pNext;

            while (b != nullptr) {
                if (a->data > b->data) {
                    if (t == a) {
                        first = b;
                    }
                    else
                        t->pNext = b;

                    a->pNext = b->pNext;
                    b->pNext = a;

                    m = a, a = b, b = m;
                    go = true;
                }
                t = a;
                a = a->pNext;
                b = b->pNext;
            }
        }
    }

