#include "TaskBlink.h"

void TaskBlink( void *pvParameters ){
	uint32_t led_delay = *((uint32_t*)pvParameters);
	const TickType_t lDelay = led_delay / portTICK_PERIOD_MS;

	pinMode(LED_PIN, OUTPUT);

	for (;;) {
		digitalWrite(LED_PIN, HIGH);
		vTaskDelay( lDelay);
		digitalWrite(LED_PIN, LOW);
		vTaskDelay( lDelay);
	}
}

