        };
        function<ll(ll, ll)> get_child_cnt = [n, &get_child_cnt, &lsb, &rsb](ll root, ll dep) -> ll {
            if (dep == 0)
                return ll(root <= n);
            if (root > n || root == 0)
                return 0ll;
            ll ls = root * 2, rs = root * 2 + 1;
            ll cnt = 0;

            if (rsb(ls, dep - 1) <= n) {
                cnt += 1ll << (dep - 1);
                if (rsb(rs, dep - 1) <= n)
                    cnt += 1ll << (dep - 1);
                else
                    cnt += get_child_cnt(rs, dep - 1);
            } else
                cnt += get_child_cnt(ls, dep - 1);
            return cnt;
        };

        ll ans = get_child_cnt(x, k);
        dbg(x, k, ans);
        ll os = x ^ 1, dep = k - 2;
        while (dep >= 0 && os) {
            ans += get_child_cnt(os, dep);
            os = ((os / 2) ^ 1), dep -= 1;
        }
        // ans += ll((x >> k) != 0) - ll(k == 0);
        cout << ans << endl;
    }
    return 0;
};

