void my_round(float num){
     num=round(num*100);
     printf("%.2f",num/100.0);
}
int main(){
    int n , m , i , j , k ;
    float sum , sumall;
    scanf("%d %d" ,&n ,&m);
    float rate[n] , score[m][n] , onesum[m];
    for( i=0 ; i<n ; i++){
        scanf("%f",&rate[i]);
        getchar();
    }
    for( j=0 ; j<m ; j++){
        sum =0;
        for( k=0 ; k<n ; k++){
            scanf("%f",&score[j][k]);
            getchar();
            sum = sum +score[j][k]*rate[k];
        }
        onesum[j]=sum;
        sumall = sumall+sum;
    }
    for(int z =0 ;z<m ; z++){
        my_round(onesum[z]);
        if(z!=m-1)printf(" ");
        else printf("\n");
    }
    my_round(sumall/m);
    printf("\n");
    return 0 ;
}

