#include <stdio.h>

void findDecreasingSequences(int array[], int n) {
    int count = 0;
    int maxLength = 0;
    int currentLength = 1;

    for (int i = 1; i < n; i++) {
        if (array[i] < array[i - 1]) {
            currentLength++;
            if (currentLength > maxLength) {
                maxLength = currentLength;
            }
        } else {
            if (currentLength > 1) {
                count++;
            }
            currentLength = 1;
        }
    }

    if (currentLength > 1) {
        count++;
    }

    printf("Брой намаляващи редици: %d\n", count);
    printf("Най-дългата намаляваща редица: %d\n", maxLength);
}

int main() {
    int n;
    printf("Въведете брой на елементите в масива: ");
    scanf("%d", &n);

    int array[n];

    printf("Въведете елементите на масива:\n");
    for (int i = 0; i < n; i++) {
        scanf("%d", &array[i]);
    }

    findDecreasingSequences(array, n);

    return 0;
}

