	img.release();
	dst.release();
	cout << "====================================================================================" << endl << endl;
}


void benchmarkDFPD(const int dataset_idx, const int iterations)
{
	const int N = 2;
	CuviLoadType loadType[N] = { CUVI_LOAD_IMAGE_GRAYSCALE, CUVI_LOAD_IMAGE_GRAYSCALE_KEEP_DEPTH };
	std::pair<std::string, CuviBayerSeq> dataset[] = { std::make_pair("F:/datasets/images/bayer/demosaic16.tif", CUVI_BAYER_RGGB), std::make_pair("F:/datasets/images/bayer/mandi16.tif", CUVI_BAYER_BGGR) };
	
	CuviStatus st;
	for (int idx = 0; idx < N; idx++)
	{
		CuviImage img = cuvi::io::loadImage(dataset[dataset_idx].first, loadType[idx]);

		if (img.isInitialized())
		{
			cout << endl << "Image : [ " << img.width() << " x " << img.height() << " ] " << cuvi::getTypeString(img.type()) << endl;
			CuviImage dst;

			CuviTimer t;
			t.Start();
			for (int i = 0; i < iterations; i++)
			{
				st = cuvi::colorOperations::demosaicDFPD(img, dst, dataset[dataset_idx].second, false);
				if (CUVI_SUCCESS != st)
				{
					cout << cuvi::getStatusString(st) << endl;
				}
			}
			t.Stop();

			cout << "(DFPD) "<< cuvi::getTypeString(dst.type()) << " Mean Elapsed Time = " << (t.GetElapsedTime() * 1000000.0f) / iterations << " us" << endl;

			//dst.show(cuvi::getTypeString(dst.type()));
			//cuvi::io::saveImage(dst, "F:/datasets/images/bayerReference/output_" + cuvi::getTypeString(dst.type()) + ".tif");

		}
		else
		{
			cout << "Image Not Initialized" << endl;
		}
	}
}

void benchmarkHQLI(const int dataset_idx, const int iterations)
{
	const int N = 2;
	CuviLoadType loadType[N] = { CUVI_LOAD_IMAGE_GRAYSCALE, CUVI_LOAD_IMAGE_GRAYSCALE_KEEP_DEPTH };
	std::pair<std::string, CuviBayerSeq> dataset[] = { std::make_pair("F:/datasets/images/bayer/demosaic16.tif", CUVI_BAYER_RGGB), std::make_pair("F:/datasets/images/bayer/mandi16.tif", CUVI_BAYER_BGGR) };
	
	const int filterSizes[] = { 5,7,9 };

	CuviStatus st;
	for (int idx = 0; idx < N; idx++)
	{
		CuviImage img = cuvi::io::loadImage(dataset[dataset_idx].first, loadType[idx]);
		
		if (img.isInitialized())
		{
			cout << endl << "Image : [ " << img.width() << " x " << img.height() << " ] " << cuvi::getTypeString(img.type()) << endl;
			for (int f = 0; f < 3; f++)
			{
				int fsize = filterSizes[f];
				CuviImage dst;// (img.size(), img.depth(), 3);

				CuviTimer t;
				t.Start();

				for (int i = 0; i < iterations; i++)
				{
					st = cuvi::colorOperations::demosaicHQLI(img, dst, dataset[dataset_idx].second, fsize);
					if (CUVI_SUCCESS != st)
					{
						cout << cuvi::getStatusString(st) << endl;
					}
				}
				t.Stop();

				cout << "(HQLI" << fsize << ") " << cuvi::getTypeString(dst.type()) << " Mean Elapsed Time = " << (t.GetElapsedTime() * 1000000.0f) / iterations << " us" << endl;

				//dst.show(cuvi::getTypeString(dst.type()));
				//cuvi::io::saveImage(dst, "F:/datasets/images/bayerReference/output_" + cuvi::getTypeString(dst.type()) + ".tif");
			}
		}
		else
		{
			cout << "Image Not Initialized" << endl;
			return;
		}
		cout << endl;
	}
}

int main()
{
	cudaBootstrap();

	const int iterations = 500;
	const int dataset_idx = 1;

	cout << "Starting benchmark with " << iterations << " iterations ..." << endl << endl;

	benchmarkDFPD(dataset_idx, iterations);
	cout << endl;
	benchmarkHQLI(dataset_idx, iterations);

	return 0;
}

var input = File.ReadAllText("input.txt").Split("\r\n\r\n").Select(p => p.Split("\r\n")).ToList();

var part1Rows = new List<int>();
var part1Cols = new List<int>();

for (var i = 0; i < input.Count; i++)
{
    var (rows, cols) = CheckPattern(i);
    part1Rows.Add(rows);
    part1Cols.Add(cols);
}

Console.WriteLine($"Part 1: {part1Rows.Sum() + part1Cols.Sum()}");

var part2Rows = 0;
var part2Cols = 0;

for (var i = 0; i < input.Count; i++)
{
    var (rows, cols) = CheckPattern(i, 1);

    part2Rows += rows;
    part2Cols += cols;
}

Console.WriteLine($"Part 2: {part2Rows + part2Cols}");
return;

(int Rows, int Columns) CheckPattern(int patternIndex, int offset = 0)
{
    var pattern = input[patternIndex];
    var rows = 0;
    var cols = 0;
    
    for (var i = 1; i < pattern.Length; i++) // Check rows.
    {
        var rowOffset = offset;
        var isMirrorRow = true;

        for (var j = 1; j <= pattern.Length - i; j++)
        {
            if (j > i || j + i > pattern.Length) break; // Outside of pattern bounds.

            var row1 = pattern[i + j - 1];
            var row2 = pattern[i - j];

            // Count the number of differences between the two rows
            var diff = row1.Select((row, rowIndex) => row == row2[rowIndex] ? 0 : 1).Sum();

            // Check if the row is a mirror of the adjacent row or the difference is within the offset.
            isMirrorRow &= diff == rowOffset || diff == 0;

            if (isMirrorRow && diff == rowOffset)
            {
                rowOffset = 0; // Offset already used, so set it to 0.
            }
        }

        // Check if all rows are mirrored and the offset, if any, has been used.
        // If there is an offset, then the result should be different from the Part 1 result.
        if (isMirrorRow && rowOffset == 0 && (offset == 0 || part1Rows[patternIndex] != i))
        {
            rows += i * 100;
            break;
        }
    }

    for (var i = 1; i < pattern[0].Length; i++) // Check columns.
    {
        var columnOffset = offset;
        var isMirrorColumn = true;

        for (var j = 1; j <= pattern[0].Length - i; j++)
        {
            if (j > i || j + i > pattern[0].Length) break; // Outside of pattern bounds.

            var col1 = pattern.Select(p => p[i + j - 1]).ToArray();
            var col2 = pattern.Select(p => p[i - j]).ToArray();

            // Count the number of differences between the two columns
            var diff = col1.Select((col, colIndex) => col == col2[colIndex] ? 0 : 1).Sum();

            // Check if the column is a mirror of the adjacent column or the difference is within the offset.
            isMirrorColumn &= diff == columnOffset || diff == 0;

            if (isMirrorColumn && diff == columnOffset)
            {
                columnOffset = 0; // Offset already used, so set it to 0.
            }
        }

        // Check if all columns are mirrored and the offset, if any, has been used.
        // If there is an offset, then the result should be different from the Part 1 result.
        if (isMirrorColumn && columnOffset == 0 &&
            (offset == 0 || part1Cols[patternIndex] != i))
        {
            cols += i;
            break;
        }
    }

    return (rows, cols);
}

