#include <stdio.h>
#include <stdlib.h>
#include <string.h>

#define MAX_USERS 100
#define MAX_ID_LENGTH 32
#define USER_FILE "voters.txt"

// Structure to represent a candidate
struct Candidate {
    char *name;
    int votes;
};

// Global variables
struct Candidate *candidates = NULL;
char votedUsers[MAX_USERS][MAX_ID_LENGTH] = {0}; // 2D array to store voted user IDs
int numCandidates = 0;

// Function prototypes
void welcome();
void displayMenu();
void manageCandidates();
void displayCandidates();
void vote();
void addCandidate();
int hasVoted(const char *userID);
void recordVote(const char *userID);
void saveUserIDs();
void loadUserIDs();

// Main function
int main() {
    loadUserIDs(); // Load existing user IDs
    welcome();
    while (1) {
        displayMenu();
    }

    return 0;
}

// Display welcome message
void welcome() {
    printf("\033[1;33m\n*****************************************\n");
    printf("*  WELCOME TO ELECTRONIC VOTING SYSTEM  *\n");
    printf("*****************************************\033[0m\n");
}

// Display the main menu and handle user input
void displayMenu() {
    int choice;

    printf("\033[1;36m\n1. Manage Candidates\n");
    printf("2. Start Voting\n");
    printf("3. Exit\n\n");
    printf("Enter your choice (1, 2, or 3): \033[0m");
    scanf("%d", &choice);

    switch (choice) {
    case 1:
        system("clear || cls");
        manageCandidates();
        break;
    case 2:
        if (numCandidates == 0) {
            printf("\033[1;31m\nNo candidates available. Please add candidates first.\033[0m\n");
            break;
        }
        system("clear || cls");
        // Only call displayCandidates() once before entering the voting process
        displayCandidates();
        vote();
        break;
    case 3:
        printf("\033[1;32m\nThank you for using the Electronic Voting System. Goodbye!\n");
        for (int i = 0; i < numCandidates; ++i) {
            printf("%s: %d votes\n", candidates[i].name, candidates[i].votes);
            free(candidates[i].name);
        }
        saveUserIDs(); // Save user IDs before exit
        free(candidates);
        exit(0);
    default:
        printf("\033[1;31mInvalid choice. Please enter 1, 2, or 3.\033[0m\n");
        exit(1);
    }
}

// Manage candidates - add or view candidates
void manageCandidates() {
    int subChoice;
    do {
        printf("\033[1;34m\n********** CANDIDATES MANAGEMENT **********\n\n");
        printf("1. Add Candidate\n");
        printf("2. View Candidates\n");
        printf("3. Back to Main Menu\n\n");
        printf("Enter your choice (1, 2, or 3): \033[0m");
        scanf("%d", &subChoice);

        switch (subChoice) {
        case 1:
            addCandidate();
            break;
        case 2:
            displayCandidates();
            break;
        case 3:
            break; // Return to the main menu
        default:
            printf("\033[1;31mInvalid choice. Please enter 1, 2, or 3.\033[0m\n");
        }
    } while (subChoice != 3);
}

// Display the list of candidates
void displayCandidates() {
    printf("\033[1;34m\n*************** CANDIDATES ****************\n\n");
    if (numCandidates == 0) {
        printf("\033[1;31mNo candidates available.\033[0m\n\n");
    } else {
        for (int i = 0; i < numCandidates; ++i) {
            printf("%d. %s\n", i + 1, candidates[i].name);
        }
    }
}

// Check if a user has already voted
int hasVoted(const char *userID) {
    for (int i = 0; i < MAX_USERS; ++i) {
        if (strcmp(votedUsers[i], userID) == 0) {
            return 1; // User has voted
        }
    }
    return 0; // User has not voted
}

// Record a user's vote
void recordVote(const char *userID) {
    for (int i = 0; i < MAX_USERS; ++i) {
        if (strlen(votedUsers[i]) == 0) {
            strncpy(votedUsers[i], userID, MAX_ID_LENGTH - 1);
            votedUsers[i][MAX_ID_LENGTH - 1] = '\0'; // Ensure null-termination
            break;
        }
    }
}

// Save user IDs to a file
void saveUserIDs() {
    FILE *file = fopen(USER_FILE, "w");
    if (file == NULL) {
        printf("\033[1;31mError opening user ID file for writing.\033[0m\n");
        return;
    }

    for (int i = 0; i < MAX_USERS; ++i) {
        if (strlen(votedUsers[i]) > 0) {
            fprintf(file, "%s\n", votedUsers[i]);
        }
    }

    fclose(file);
}

// Load user IDs from a file
void loadUserIDs() {
    FILE *file = fopen(USER_FILE, "r");
    if (file == NULL) {
        // If the file does not exist, just return
        return;
    }

    char userID[MAX_ID_LENGTH];
    while (fscanf(file, "%s", userID) == 1) {
        for (int i = 0; i < MAX_USERS; ++i) {
            if (strlen(votedUsers[i]) == 0) {
                strncpy(votedUsers[i], userID, MAX_ID_LENGTH - 1);
                votedUsers[i][MAX_ID_LENGTH - 1] = '\0'; // Ensure null-termination
                break;
            }
        }
    }

    fclose(file);
}

// Perform the voting process
void vote() {
    char userID[MAX_ID_LENGTH];
    int choice;

    while (1) {
        printf("\033[1;36m\nEnter your user ID (up to %d characters): \033[0m", MAX_ID_LENGTH);
        scanf("%s", userID);

        if (hasVoted(userID)) {
            printf("\033[1;31mYou have already voted.\033[0m\n");
        } else {
            printf("\033[1;36mEnter your choice (1-%d) or %d to exit: \033[0m", numCandidates, numCandidates + 1);
            scanf("%d", &choice);

            if (choice >= 1 && choice <= numCandidates) {
                printf("\033[1;32m\nYou voted for %s.\n\n", candidates[choice - 1].name);
                candidates[choice - 1].votes++;
                recordVote(userID); // Record the user's vote
            } else if (choice == numCandidates + 1) {
                // Exit the voting process
                break;
            } else {
                printf("\033[1;31mInvalid choice. Please enter a number between 1 and %d.\033[0m\n", numCandidates + 1);
            }
        }

        // Check if the user wants to continue voting
        printf("\033[1;36m1. Vote\n");
        printf("2. Show Results\n");
        printf("Enter your choice (1 or 2): \033[0m");
        scanf("%d", &choice);

        if (choice == 2) {
            // Show results and exit the voting process
            printf("\033[1;32m\nThank you for voting!\n\n");
            printf("Results:\n");
            for (int i = 0; i < numCandidates; ++i) {
                printf("%s: %d votes\n", candidates[i].name, candidates[i].votes);
                free(candidates[i].name);
            }
            printf("\n");
            free(candidates);
            saveUserIDs(); // Save user IDs before exit
            return;
        }
    }
}

// Add candidates to the system
void addCandidate() {
    int newNumCandidates;
    printf("\033[1;36m\nEnter the number of candidates: \033[0m");
    scanf("%d", &newNumCandidates);

    if (newNumCandidates <= 0) {
        printf("\033[1;31mInvalid number of candidates. Exiting...\033[0m\n");
        exit(1);
    }

    // Allocate memory for the new candidates
    candidates = (struct Candidate *)realloc(candidates, (numCandidates + newNumCandidates) * sizeof(struct Candidate));

    if (candidates == NULL) {
        printf("\033[1;31mMemory allocation error. Exiting...\033[0m\n");
        exit(1);
    }

    // Clear the input buffer
    while (getchar() != '\n');

    for (int i = numCandidates; i < numCandidates + newNumCandidates; ++i) {
        printf("\033[1;36mEnter the name of candidate %d (up to 32 characters): \033[0m", i + 1);

        // Allocate memory for candidate name
        candidates[i].name = (char *)malloc((MAX_ID_LENGTH + 1) * sizeof(char));

        // Use fgets to allow spaces in candidate names and limit to 32 characters
        fgets(candidates[i].name, MAX_ID_LENGTH + 1, stdin);

        // Remove the newline character from the input
        size_t len = strlen(candidates[i].name);
        if (len > 0 && candidates[i].name[len - 1] == '\n') {
            candidates[i].name[len - 1] = '\0';
        } else {
            // Clear the input buffer in case the name exceeds 32 characters
            while (getchar() != '\n');
        }

        // Limit the name to 32 characters
        candidates[i].name[MAX_ID_LENGTH] = '\0';

        candidates[i].votes = 0;
    }

    numCandidates += newNumCandidates;
}

def validate(condition: str, springs: tuple[int, ...]) -> bool:
    gen_springs = [len(s) for s in condition.split(".") if len(s) > 0]
    return gen_springs == list(springs)


@lru_cache(maxsize=None)
def count_combinations(condition: str, springs: tuple[int, ...]) -> int:
    if "?" not in condition:
        return int(validate(condition, springs))
    elif len(springs) == 0:
        return int(validate(condition.replace("?", "."), springs))

    condition = re.sub(r"^\.+", "", condition, count=1)

    q_remaining = len(re.findall(r'\?', condition))
    hash_remaining = sum(springs) - len(re.findall(r'#', condition))

    if hash_remaining == q_remaining:
        condition = condition.replace("?", "#")
        return int(validate(condition, springs))

    count = 0
    condition_dot = condition.replace("?", ".", 1).split(".")
    if len(condition_dot[0]) == springs[0]:
        new_count = count_combinations(".".join(condition_dot[1:]), springs[1:])
        count += new_count
    elif len(condition_dot[0]) == 0:
        new_count = count_combinations(condition[1:], springs)
        count += new_count
    try:
        # print(".".join(condition_dot), "->", new_count, springs)
        pass
    except UnboundLocalError:
        pass

    new_count = count_combinations(condition.replace("?", "#", 1), springs)
    count += new_count
    # print(".".join(condition_dot), "->", new_count, springs)
    return count

// Включение необходимых заголовочных файлов
#define _CRT_SECURE_NO_WARNINGS
#include <locale.h>
#include <stdio.h>
#include <stdlib.h>
#include <string.h>

// Максимальная длина имени файла и размер буфера для чтения/записи
#define MAX_FILENAME_LENGTH 100
#define MAX_BUFFER_SIZE 1000

// Поиск символа в строках и запись в выходной файл
void processTask1(FILE* inputFile, FILE* outputFile, char targetSymbol) {
    // Буфер для чтения из файла
    char buffer[MAX_BUFFER_SIZE];
    while (fgets(buffer, sizeof(buffer), inputFile) != NULL) {
        size_t length = strlen(buffer);

        // Проверка каждого символа в строке на совпадение с целевым символом
        for (size_t i = 0; i < length; i++) {
            if (buffer[i] == targetSymbol) {
                // Запись строки в выходной файл, если найден целевой символ
                fputs(buffer, outputFile);
                fflush(outputFile);
                break;
            }
        }
    }
}

// Замена пробелов на последние символы в строках
void processTask2(FILE* inputFile, FILE* outputFile, int maxReplacements) {
    // Буфер для чтения из файла
    char buffer[MAX_BUFFER_SIZE];

    // Чтение строк из входного файла
    while (fgets(buffer, sizeof(buffer), inputFile) != NULL) {
        size_t length = strlen(buffer);

        // Перебор символов в строке
        for (size_t i = 0; i < length; i++) {
            if (buffer[i] == ' ' && maxReplacements > 0) {
                // Замена пробелов на последние символы в строках, ограниченные максимальным количеством замен
                char lastChar = buffer[length - 2];  // Последний символ в строке
                fputc(lastChar, outputFile);
                maxReplacements--;
            }
            else {
                // Запись символов в выходной файл
                fputc(buffer[i], outputFile);
            }
        }
    }
}

int main() {
    setlocale(LC_ALL, "Russian");

    // Имена входного и выходного файлов, выбор пользователя и буфер для имени выходного файла
    char inputFileName[MAX_FILENAME_LENGTH];
    char outputFileName[MAX_FILENAME_LENGTH + 4];  // +4 для ".out"
    int choice;

    // Ввод пользователем выбора задачи
    printf("Выберите задачу (1 для задачи 4.1, 2 для задачи 4.2): ");
    scanf("%d", &choice);

    // Ввод пользователем имени входного файла
    printf("Введите имя входного файла: ");
    scanf("%s", inputFileName);

    // Создание имени выходного файла путем удаления расширения
    snprintf(outputFileName, sizeof(outputFileName), "%.*s.out", (int)strcspn(inputFileName, "."), inputFileName);

    // Открытие входного и выходного файлов
    FILE* inputFile = fopen(inputFileName, "r");
    FILE* outputFile = fopen(outputFileName, "w");

    // Проверка успешности открытия файлов
    if (inputFile == NULL || outputFile == NULL) {
        perror("Ошибка открытия/создания файлов");
        if (inputFile != NULL) fclose(inputFile);
        if (outputFile != NULL) fclose(outputFile);
        exit(1);
    }

    // Выбор задачи и выполнение соответствующей функции
    switch (choice) {
    case 1: {
        char targetSymbol;
        // Ввод символа для поиска
        printf("Введите символ для поиска: ");
        scanf(" %c", &targetSymbol);
        processTask1(inputFile, outputFile, targetSymbol);
        printf("Задача 4.1 завершена. Результат записан в файл %s\n", outputFileName);
        break;
    }
    case 2: {
        int maxReplacements;
        printf("Введите максимальное количество замен: ");
        scanf("%d", &maxReplacements);
        processTask2(inputFile, outputFile, maxReplacements);
        printf("Задача 4.2 завершена. Результат записан в файл %s\n", outputFileName);
        break;
    }
    default:
        printf("Неправильный выбор.\n");
        break;
    }

    // Закрытие файлов
    fclose(inputFile);
    fclose(outputFile);

    return 0;
}

#include <stdio.h>
#include <stdlib.h>
#include <stdbool.h>
#include <string.h>
 
typedef struct point point;
struct point{
    int data;
    point *left, *right;
};
 
int tp(int t){
    int ans=1;
    for (int i=0; i<t; i++) ans = ans<<1;
    return ans;
}
 
point* mktree(){
    char c;
    point *pt;
    pt = (point*)malloc(sizeof(point));
    scanf("%c", &c);
    if (c=='('){
        pt->left = mktree();
        scanf("%c", &c);
    }
    else{
        int cur=0;
        do{
            cur*=10; cur+=(c-'0');
            scanf("%c", &c);
        } while (c!=',');
        point *lpt;
        lpt = (point*)malloc(sizeof(point));
        lpt->left = NULL; lpt->right = NULL;
        lpt->data = cur;
        pt->left = lpt;
    }
    scanf("%c", &c);
    if (c=='('){
        pt->right = mktree();
        scanf("%c", &c);
    }
    else{
        int cur=0;
        do{
            cur*=10; cur+=(c-'0');
            scanf("%c", &c);
        } while (c!=')');
        point *rpt;
        rpt = (point*)malloc(sizeof(point));
        rpt->left = NULL; rpt->right = NULL;
        rpt->data = cur;
        pt->right = rpt;
    }
    pt->data = pt->left->data + pt->right->data;
    return pt;
}
 
void traverse(point *node, int mode){
    if (node==NULL) return;
    point* order[2] = {node->left, node->right};
    printf("%d\n", node->data);
    traverse(order[mode], (mode+1)%2);
    printf("%d\n", node->data);
    traverse(order[(mode+1)%2], (mode+1)%2);
}
 
int main(){
    char temp; scanf("%c", &temp);
    point *first = mktree();
    traverse(first, 0);
}
